namespace MyM365App.Helpers
{
    public class IconHelper
    {
        public static string GetDocumentIcons(string fileType)
        {
            string result;
            switch (fileType)
            {
                case "PowerPoint":
                case "pptx":
                case "ppt":
                    result = "data:image/png;base64,";
                    break;
                case "Word":
                case "docx":
                case "doc":
                    result = "data:image/png;base64,";
                    break;
                case "Excel":
                case "xlsx":
                case "xls":
                    result = "data:image/png;base64,";
                    break;
                case "Pdf":
                case "pdf":
                    result = "data:image/png;base64,";
                    break;
                case "spsite":
                    result = "data:image/png;base64,";
                    break;
                case "folder":
                    result = "data:image/png;base64,";
                    break;
                case "onenote":
                case "notebook":
                    result = "data:image/png;base64,";
                    break;
                case "event":
                    result = "data:image/png;base64,";
                    break;
				default:
                    result = "data:image/png;base64,";
                    break;
            }

            return result;
        }

    }
}
